from wagtail.images.models import Image


def save_image_from_url(pv, url):
    """
    Save remote images from url to image field.
    Requires python-requests
    """
    # try
    i = None
    oi = ProductVariantImage.objects.filter(url=url)

    if oi.count():

        i = oi.first().image
        print(i)
    else:
        r = requests.get(url)
        if r.status_code == 200:
            print(r.status_code, url)
        try:
            i = Image(title=pv.title, file=ImageFile(BytesIO(r.content), name=os.path.basename(url)))
            i.save()
            pvi = ProductVariantImage(variant=pv)
            pvi.image = i
            pvi.url = url
            pvi.save()
        except:
            pass
    # except:
    #     pass


