def load_prducts(x):
    print(x['sku'])
    f, c = Family.objects.get_or_create(code=x['family'])
    if c:
        f = Family(code=x['family'], name=x['family_text'])
        f.save()
    fo, c = OptionValue.objects.get_or_create(family=f)
    if c:
        fo = OptionValue.objects.create(family=f, name=f.name)

    op, c = OptionValue.objects.get_or_create(option=fo, value=x['size'])
    if c:
        op.text = x['size_desc']
        op.save()

    sft = x['subfamily'].split("/")
    sf, c = SubFamily.objects.get_or_create(code=sft[0], name=sft[1])

    p = ProductModel.objects.filter(
        title=x['grand_parent_title'],
        sku=x['grand_parent_sku'],

    )
    if not p:
        p = ProductModel()
        p.title = x['grand_parent_title']
        p.sku = x['grand_parent_sku']
        p.description = x['grand_parent_description']
        p.retail_price = round(Decimal(x['retail_price']), 2)
        p.price = round(Decimal(x['price']), 2)
        p.brand = Brand.objects.get(id=x['brand'])
        p.gender = x['gender']
        # pt, c = ProductType.objects.get_or_create(name=x['product_type'])
        # p.product_type = pt

        p.subfamily = sf
        p.sale_price = round(0, 2)
        parent_page.add_child(instance=p)
        p.save()

    else:
        p = p[0]

    y = x['categories'].split("/")
    cat = None
    for v in y:
        if not cat:
            cat = get_category(slug=v)
        else:
            p_cat = cat
            cat = get_category(root=cat, slug=v)
            if not cat:
                cat = p_cat

        if cat:
            # print(cat.full_name)
            x1, c = ProductCategory.objects.get_or_create(product=p, category=cat)
    try:
        ci, ci2 = x['color_index'].split("/")
    except:
        ci = x['color_index']
        ci2 = None
    color = Color.objects.filter(code=ci).first()
    ct = x['color_desc'].split("/")
    color2 = None
    if not color:
        color = Color.objects.create(code=ci, name=ct[0])
    color.simplified_temp_name = x['color_simplified']
    color.save()
    print(ct)
    if ci2:
        color2 = Color.objects.filter(code=ci2).first()
        # print(color2)
        if not color2:
            color2 = Color.objects.create(code=ci2, name=ct[1])
    pv = ProductVariant.objects.filter(slug=slugify(x['parent_title']))
    if not pv:
        pv = ProductVariant()

        pv.product_model = p
        pv.color = color
        pv.sku = x['parent_sku']
        pv.title = x['parent_title']
        pv.slug = slugify(x['parent_title'])

        try:
            p.add_child(instance=pv)
        except:
            pv.slug = pv.slug + '-alt'
            print(pv.slug)
            p.add_child(instance=pv)
        pv.save()
    else:
        pv = pv[0]
    if color2:
        pv.color2 = color2
    pv.save()
    pvo = ProductInventory.objects.filter(sku=x['sku'])
    if not pvo:
        pvo = ProductInventory()
        pvo.sku = x['sku']
        pvo.ean = x['ean']
        pvo.option = op
        pvo.quantity = randrange(50)
        pvo.product = pv
        pvo.save()
    else:
        pvo = pvo[0]
    sw = False
    for i in range(1, 10):
        url = f"https://www.izas-outdoor.com/media/catalog/product/{x['parent_sku'][0].lower()}/{x['parent_sku'][1].lower()}/{x['parent_sku'].replace('/', '_').lower()}-{i}.jpg"
        try:
            save_image_from_url(pv, url)
            continue
        except:
            for j in range(1, 4):
                url = f"https://www.izas-outdoor.com/media/catalog/product/{x['parent_sku'][0].lower()}/{x['parent_sku'][1].lower()}/{x['parent_sku'].replace('/', '_').lower()}-{i}_{j}.jpg"
                try:
                    save_image_from_url(pv, url)
                    continue
                except:
                    if not sw:
                        url = x['image']
                        save_image_from_url(pv, url)
                        sw = True
                        break


